MERGE INTO [dbo].[__MigrationHistory] AS Target
USING (VALUES
(N'201810140404071_InitialCreate', N'EWS.Common.Database.EWSDbContext', , N'6.2.0-61023')
) AS SOURCE ([MigrationId], [ContextKey], [Model], [ProductVersion])
ON (Target.[MigrationId] = Source.[MigrationId])
WHEN MATCHED THEN
UPDATE SET
[MigrationId] = Source.MigrationId,
[ContextKey] = Source.[ContextKey], 
[Model] = Source.[Model], 
[ProductVersion] = Source.[ProductVersion]
WHEN NOT MATCHED BY TARGET THEN
INSERT ([MigrationId], [ContextKey], [Model], [ProductVersion])
VALUES(Source.MigrationId, Source.[ContextKey], Source.[Model], Source.[ProductVersion])
;

